import React from 'react'
import Navbar from '../../components/NavBar'
import { SearchOutline } from 'antd-mobile-icons'
export default function CityLists() {
  return (
    <div className="cityList">
      <Navbar title={'城市选择'} right={<SearchOutline />}/>
    </div>
  )
}
